MaryBeth Pappas Baun, &quot;Fantastic Water Workouts, 2nd edition&quot;
English | ISBN: 0736068082 | 2008 | 240 pages | PDF | 4 MB

With more than 130 exercises that use the natural resistance of water, the reader will improve body's composition and tone, strengthen muscles, increase aerobic and muscular endurance and improve flexibility, coordination and agility, all with minimal stress on the body.In addition to the unique and creative individual exercises, &quot;Fantastic Water Workouts&quot; includes 15 step-by-step programmes that can be tailored to meet personal needs, interests and fitness goals.Whether the reader is seeking general programmes for overall fitness, cross-training and improved performance or more specific routines for pregnancy, physical rehabilitation, cardiac recovery, or older adults, it's all here.Variety can be added to a programme by trying the tai chi, Pilates, yoga, kickboxing, country line dancing, street dancing and noodle workouts.
